import './App.css';
import logo from './logo.svg'
function Main() {

  return (
    <div className="App">
      <header className="App-header">
        <div>
            모두가 개발자가 된다
        </div>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default Main;
